import {BrowserRouter, Route} from "react-router-dom";
import Main_page from "./components/pages/Main_page";

function App() {
  return (
    <BrowserRouter>
          <Route>
              <Main_page path="/main_page" />
          </Route>
    </BrowserRouter>
  );
}

export default App;
